<title>SVG Rollovers</title>
<style>
body{
	margin:0;
	padding:0;
	background-color:#CCC;
	}
wrapper{
	width:100%;
	max-width:1024px;
	margin:0 auto;
	display:block;
	}
header{
	height:150px;
	background-color:#FBB03B;
	}
main{
	text-align:center;
	background-color:#fff;
	padding: 1em 0;
	}
footer{
	height:80px;
	background-color:#FBB03B;
	clear:both;
	}
#shape-blue{
		fill:#3fa9f5;
	}
#shape-red{
		fill:#ff1d25;
	}
#shape-green{
	fill:#7ac943;
	}
#shape-orange{
		fill:#ff931e;
	}
#segment-blue:hover #shape-blue{
		fill:darkblue;
	}
#segment-red:hover #shape-red{
		fill:darkred;
	}
#segment-green:hover #shape-green{
	fill:darkgreen;
	}
#segment-orange:hover #shape-orange{
		fill:#CC6600;
	}
#gloves,#yarn,#thread,#kimono{
		visibility: hidden;
	}
#segment-blue:hover #thread{
		visibility: visible;
	}
#segment-red:hover #yarn{
		visibility: visible;
	}
#segment-green:hover #gloves{
	visibility: visible;
	}
#segment-orange:hover #kimono{
		visibility: visible;
	}
</style>
</head>
